from sqlalchemy.orm import Session
from .database.db import SessionLocal, engine, Base
from .database.models.anime import Anime
from .database.models.character import Character


def seed_database():
    Base.metadata.create_all(bind=engine)
    db: Session = SessionLocal()

    try:
        # Avoid duplicate seeds
        if db.query(Anime).first():
            print("Database already seeded.")
            return

        # ---- Animes ----
        naruto = Anime(
            title="Naruto",
            studio="Pierrot",
            release_year=2002
        )

        one_piece = Anime(
            title="One Piece",
            studio="Toei Animation",
            release_year=1999
        )

        db.add_all([naruto, one_piece])
        db.commit()

        # ---- Characters ----
        characters = [
            Character(
                name="Naruto Uzumaki",
                role="main",
                description="A ninja who dreams of becoming Hokage",
                anime_id=naruto.id,
                image_url="data:image/jpeg;base64,"
            ),
            Character(
                name="Sasuke Uchiha",
                role="support",
                description="Naruto's rival and a skilled ninja",
                anime_id=naruto.id,
                image_url="data:image/jpeg;base64,"
            ),
            Character(
                name="Monkey D. Luffy",
                role="main",
                description="Pirate who wants to be King of the Pirates",
                anime_id=one_piece.id,
                image_url="data:image/jpeg;base64,"
            ),
            Character(
                name="Roronoa Zoro",
                role="support",
                description="Swordsman and Luffy's first crew member",
                anime_id=one_piece.id,
                image_url="data:image/jpeg;base64,"
            )
        ]

        db.add_all(characters)
        db.commit()

        print("Database seeded successfully.")

    finally:
        db.close()


if __name__ == "__main__":
    seed_database()
